import React, { Component } from 'react';
import banierrtrip from '../../static/images/banieretrip.png';
import logo from '../../static/images/BIRAMAWA LOGO 3D 8.png';
import './Trip.scss';
import lac from '../../static/images/686_ragdefault.png';
import image4 from '../../static/images/images.png';
import image3 from '../../static/images/image3.png';
import image2 from '../../static/images/images2.png';


class Trip extends Component {
    constructor(){
        super();
        this.clearInterval();
    }
    clearInterval(){
        let idI=parseInt(sessionStorage.getItem("idInterval"));
        console.log(idI);
        clearInterval(idI);
      }
    render() {
        return (
        <div style={{maxHeight:"500px"}}>
            <div id="baniere">
                <div className="row">
                    <div className="col-lg-3 col-md-3 col-xs-3 col-sm-3"  id="menutrip">
                        <img height="150px" width="100%" src={logo} alt="logo" />
                        <i style={{color:"white"}} className="fas fa-bars"></i>
                    </div>
                    <div className="col-lg-9 col-md-9 col-xs-9 col-sm-9" >
                        <div style={{marginTop:"2em",width:"90%"}}>
                            <ul id="menutrip2">
                                <li style={{borderBottom:"3px solid rgb(255, 208, 48)"}}>SITES D'EXCEPTION</li>
                                <li>NOS PARTENAIRES</li>
                            </ul>
                        </div>
                        <div >
                            <form style={{marginLeft:"27%"}} className="form-inline">
                                <input type="search" />
                                <input style={{backgroundColor:"rgb(255, 208, 48)"}} type="button" value="Recherche" />
                            </form>
                        </div>
                        <div>
                            <p style={{color:"white",fontSize:"3em",paddingLeft:"15%",marginBottom:"0px"}}>35 SITES</p>
                            <p style={{color:"white",fontSize:"3em"}}> D'EXCEPTION A DECOUVRIR</p>
                        </div>

                    </div>
                </div>
            </div>
            <div style={{width:"80%",marginLeft:"auto",marginRight:"auto"}} className="row">
                            <div style={{height:"150px"}} className="col-lg-3 col-md-3 col-xs-3 col-sm-3">
                                <img height="100%" width="100%" src={lac} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-3 col-xs-3 col-sm-3">
                                <img height="100%" width="100%" src={image4} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-3 3 col-sm-3">
                                <img height="100%" width="100%" src={lac} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-4 3 col-sm-3">
                                <img height="100%" width="100%" src={image3} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-4 3 col-sm-3">
                                <img height="100%" width="100%" src={image2} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-4 3 col-sm-3">
                                <img height="100%" width="100%" src={image3} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-4 3 col-sm-3">
                                <img height="100%" width="100%" src={image4} alt="" />
                            </div>
                            <div style={{height:"150px"}} className="col-lg-3 col-md-4 3 col-sm-3">
                                <img height="100%" width="100%" src={image2} alt="" />
                            </div>
                        </div>
        </div>
        );
    }
}

export default Trip;
